// 递归函数，控制显示最内三层的标签，其他层级的标签隐藏
function setLabelVisibility(node, depth) {
  if (depth <= 1) {
    node.label = {
      show: true,
      rotate: '',
      fontStyle: 'italic',
      fontSize: 15,
      color: '#3369e7',  // 设置字体颜色为白色
      fontWeight: 'bold'  // 设置字体加粗
    };
  } else {
    node.label = {
      show: false,
      rotate: '',
      fontStyle: 'italic',
      fontSize: 15,
      color: '#3369e7',
      fontWeight: 'bold'
    };
  }
  if (node.children) {
    node.children.forEach(child => {
      setLabelVisibility(child, depth + 1);
    });
  }
}

// 调用函数设置标签可见性
data.forEach(node => {
  setLabelVisibility(node, 1);
});

option = {
  series: {
    type: 'sunburst',
    data: data,
    radius: [0, '90%'],
    label: {
      show: false,
      emphasis: {
        show: true
      }
    },
    emphasis: {
      itemStyle: {
        color: '#ff6600'
      }
    }
  }
};

var isOuterLinkClicked = false;  // 跟踪最外层链接是否被点击

// Handle node click event
myChart.on('click', function(params) {
  var node = params.data;

  // 判断是否点击了最外层链接
  if (node.link && !isOuterLinkClicked) {
    isOuterLinkClicked = true;  // 标记最外层链接已点击
  } else {
    if (node.link) {
      // 在新页面打开链接
      window.open(node.link, '_blank');
    }
  }
});


if (option && typeof option === 'object') {
  myChart.setOption(option);
}

window.addEventListener('resize', myChart.resize);


